importScripts('https://storage.googleapis.com/workbox-cdn/releases/3.4.1/workbox-sw.js');

if (workbox) {
  console.log(`Yay! Workbox is loaded ðŸŽ‰`);

  workbox.precaching.precacheAndRoute([
  {
    "url": "assets/css/ipad.css",
    "revision": "ce326a1e58ea6f69895bbb5ebcca71fd"
  },
  {
    "url": "assets/css/main-portrait.css",
    "revision": "931fe57bc16f8a3bed4e3117a09cb0d4"
  },
  {
    "url": "assets/css/main.css",
    "revision": "8ee872a0235c0011bef5dc767eb7ce82"
  },
  {
    "url": "assets/css/main2.css",
    "revision": "73fae3b7d22fcbf545921683d0e47808"
  },
  {
    "url": "default3.csv",
    "revision": "fabc72f36107052885c75f204d862357"
  },
  {
    "url": "index.html",
    "revision": "5e0f20591c0ab936367ac94a810e3a17"
  }
]);

  const articleHandler = workbox.strategies.networkFirst({
    cacheName: 'document-cache',
    plugins: [
      new workbox.expiration.Plugin({
        maxEntries: 50,
      })
    ]
  });
  
  workbox.routing.registerRoute(/(.*)\.html/, args => {
    return articleHandler.handle(args);
  });

  workbox.routing.registerRoute(/\/$/, args => {
    return articleHandler.handle(args);
  });


} else {
  console.log(`Boo! Workbox didn't load ðŸ˜¬`);
}
